import React from "react";
import NavBar from "./NavBar";
import CharacterPage from "./CharacterPage";
import Houses from "./Houses";

function App() {
  return (
    <div className="App">
      <NavBar />
      <CharacterPage />
      <Houses />
    </div>
  );
}

export default App;
